import { Link } from "react-router-dom";

export default function Navbar() {
  return (
    <nav>
      <Link to="/">Home</Link> |{" "}
      <Link to="/paintings">Paintings</Link> |{" "}
      <Link to="/writing">Drawings</Link> 
      <Link to="/covers">Covers</Link> |{" "}
      <Link to="/writing">Writing</Link>
    </nav>
  );
}
